import React from "react";

import Shop_Image from "./Shop_Image";
import Shop_Details from "./Shop_Details";


function Shop(props){
    return(
  <>
    <div className="main">
        <br></br>
        <hr className="line"></hr>
        
        <Shop_Image></Shop_Image>
        <Shop_Details chain1={props.shopname} ></Shop_Details>
    </div>
  </>
    );
}

export default Shop;
